import React from 'react';
import { Link } from 'react-router-dom';
import { routes } from '../Routes';
import { useGlobalStates } from './utils/global.context';

const Navbar = () => {
  const { state, dispatch } = useGlobalStates();

  const style = { color: state.dark ? '#FFF' : undefined };
  const containerStyle = {
    backgroundColor: state.dark ? '#566573' : undefined,
  };

  const toggleDarkMode = () => {
    dispatch({ type: state.dark ? 'light' : 'dark' });
  };

  return (
    <div className="container" style={containerStyle}>
      <div className="nav_title">
        <p className="p1" style={style}>
          DH
        </p>
        <p className="p2" style={style}>
          Odonto
        </p>
      </div>

      <nav>
        <Link to={routes.home} className="link" style={style}>
          <p>Home</p>
        </Link>
        <Link to={routes.contact} className="link" style={style}>
          <p>Contact</p>
        </Link>
        <Link to={routes.favs} className="link" style={style}>
          <p>Favs</p>
        </Link>
        <button
          onClick={toggleDarkMode}
          className="btn"
          style={{
            color: state.dark ? 'white' : undefined,
            background: state.dark ? 'LightSkyBlue' : undefined,
          }}
        >
          {state.dark ? 'ðŸŒž' : 'ðŸŒ›'}
        </button>
      </nav>
    </div>
  );
};

export default Navbar;
